import torch.nn.functional as F


MODEL_PATH = "./models/model.pb"


def readb64(base64_string):
    prefix = "data:image/jpg;base64,"
    base64_string = base64_string.replace(prefix, "")

    prefix = "data:image/png;base64,"
    base64_string = base64_string.replace(prefix, "")

    prefix = "data:image/jpeg;base64,"
    base64_string = base64_string.replace(prefix, "")
    decoded_image = b64decode(base64_string)

    if not os.path.exists("./repository"):
        os.mkdir("./repository")

    save_file_name = "./repository/{}_{}.jpg".format(
        np.random.randint(0, 10000),
        int(time.time())
    )

    with open(save_file_name, "wb") as f:
        f.write(decoded_image)

    return Image.open(save_file_name)


def predict(model, b64_im):
    pil_im = readb64(b64_im)
    np_im = np.array(pil_im)
    shape = np_im.shape
    if len(shape) == 3 and shape[2] == 4:
        pil_im = pil_im.convert("RGB")
    elif len(shape) < 3 or shape[2] < 3:
        raise Exception('RGB 3 Channels Image was Expected')

    transform = transforms.Compose(
        [
            transforms.Resize((224, 224)),
            # transforms.RandomCrop((224, 224)),
            # transforms.Grayscale(num_output_channels=1),
            transforms.ToTensor(),
            transforms.Normalize((0.5, 0.5, 0.5), (0.5, 0.5, 0.5))
        ]
    )
    inputs = transform(pil_im)
    inputs.unsqueeze_(0)
    inputs = Variable(inputs)
    if torch.cuda.is_available():
        inputs = inputs.cuda()
    outputs = F.log_softmax(model(inputs), dim=1)
    val, idx = torch.max(outputs, 1)
    idx = idx.data[0]
    confidence = 100 - abs(int(100 * val.data[0]))
    labels = [
        "4015100197006",
        "5000174003451",
        "7702018401024",
        "8001090047069",
        "8001090703835",
        "8710364023035",
        "8710364045068",
        "8710364070336",
        "4015400835851",
        "73103714",
        "7702018447923",
        "8001090672124",
        "8001090732934",
        "8710364042852",
        "8710364070329",
        "8710364070343",
        "20180621_121330",
        "2608690098",
        "2608690167",
        "3165140786935"
    ]

    labels.sort()

    return labels[idx], confidence


